import Books from "../Books";
import BookList from "./BookList";


const Home = () => {
    const BooksList = Books.map((book) => (
        <BookList name={book.name} image={book.image} key={book.id} />
    ));
    return (
        <div className="list">{BooksList}</div>
    )
};

export default Home;
